import React from 'react';
import './App.css';
import SuperheroesList from './SuperheroesList'
import SuperheroView from './SuperheroView'
import Villians from './Villians'



function App() {

  return (
    <div className="App">
      <SuperheroesList/>
      <SuperheroView/>
      <Villians/>

    </div>
  )
}

export default App;
